  data collected during the EX1504L1 (CAPSTONE NWHI & Johnston Exploration Mapping)
  expedition on NOAA Ship OKEANOS EXPLORER in the North Pacific Ocean from 2015-07-10
  to 2015-07-24 (NCEI Accession 0131126)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-09-05T23:29:30.246188\",\n\t\"name\": \"oceanographic-data-collected-during-the-ex1504l1-capstone-nwhi-johnston-exploration-mapping-exp\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Multibeam and singlebeam mapping operations
  were conducted 24 hours a day throughout the cruise. Sub-bottom profile mapping
  was conducted 24 hours a day at the discretion of the CO. Most of the mapping areas
  pursued during this cruise were never mapped with modern sonar before. Mapping activities
  focused on three primary areas, (1) some potential underwater cultural heritage
  sites south of Oahu, (2) the Necker Island area within the Papahanaumokuakea Marine
  National Monument (PMNM), and (2) the Karin Seamount Chain near Johnston Atoll within
  the recently expanded Pacific Remote Islands Marine National Monument (PRIMNM).\",\n\t\"license_title\":
